import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet'; // Assuming you're using react-leaflet for the map
import 'leaflet/dist/leaflet.css';

const AssetOverview = () => {
    const [assets, setAssets] = useState([]);

    useEffect(() => {
        const fetchAssets = async () => {
            try {
                const response = await axios.get('http://127.0.0.1:5000/get_pipeline_stage');
                setAssets(response.data.dataset || []);
            } catch (err) {
                console.error('Error fetching assets:', err);
            }
        };
        fetchAssets();
    }, []);

    // Function to center map based on all assets' locations
    const getMapCenter = () => {
        if (assets.length === 0) return [40.7128, -74.0060]; // Default to NYC
        const latitudes = assets.map(asset => asset.Latitude);
        const longitudes = assets.map(asset => asset.Longitude);
        const latCenter = latitudes.reduce((a, b) => a + b) / latitudes.length;
        const lonCenter = longitudes.reduce((a, b) => a + b) / longitudes.length;
        return [latCenter, lonCenter];
    };

    return (
        <div style={{ padding: '20px' }}>
            <h2>Asset Overview</h2>
            <div style={{ marginBottom: '20px' }}>
                <h3>Assets Table</h3>
                <table>
                    <thead>
                        <tr>
                            <th>Asset</th>
                            <th>Latitude</th>
                            <th>Longitude</th>
                            <th>Operational Status</th>
                            <th>Speed</th>
                            <th>Heading</th>
                        </tr>
                    </thead>
                    <tbody>
                        {assets.map((row, index) => (
                            <tr key={index}>
                                <td>{row.Asset}</td>
                                <td>{row.Latitude}</td>
                                <td>{row.Longitude}</td>
                                <td>{row.OperationalStatus}</td>
                                <td>{row.Speed}</td>
                                <td>{row.Heading}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>

            <div style={{ height: '400px', marginBottom: '20px' }}>
                <h3>Assets Map</h3>
                <MapContainer center={getMapCenter()} zoom={12} style={{ width: '100%', height: '100%' }}>
                    <TileLayer
                        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                    />
                    {assets.map((asset, index) => (
                        <Marker key={index} position={[asset.Latitude, asset.Longitude]}>
                            <Popup>
                                <strong>{asset.Asset}</strong><br />
                                Latitude: {asset.Latitude}<br />
                                Longitude: {asset.Longitude}<br />
                                Status: {asset.OperationalStatus}
                            </Popup>
                        </Marker>
                    ))}
                </MapContainer>
            </div>

            <Link to="/" className="btn btn-primary">Back to Transformation</Link>
        </div>
    );
};

export default AssetOverview;
